CREATE TABLE plan2 (
  planID smallint(6) NOT NULL,
  sectionCode varchar(4) NOT NULL,
  bookCode varchar(3) NOT NULL,
  startChapter smallint(6) NOT NULL,
  startVerse smallint(6) NOT NULL,
  endChapter smallint(6) NOT NULL,
  endVerse smallint(6) NOT NULL,
  PRIMARY KEY (planID);
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

